INSERT INTO `dmptemplates` VALUES (38016095,'BBSRC Template','BBSRC template',1,NULL,737808679,'2013-10-09 15:24:49','2013-10-09 15:24:49','en',NULL),(145199482,'NERC Template','<p>The mandatory, single page, <strong>Outline</strong> Data Management Plan (ODMP) is required for all grant and fellowship applications submitted from 1 August 2012. The ODMP will identify data sets likely to be made available to NERC Data Centres for archiving and reuse at the end of the fellowship or grant. The ODMP will form the final page of the Case for Support for all schemes. The Case for Support for successful proposals will be made available to the NERC <a href=\'http://www.nerc.ac.uk/research/sites/data/\' target=\'_blank\'>Environmental Data Centres</a> and, where appropriate, used to draft, in collaboration with the Principal Investigator, a <strong>Full</strong> Data Management Plan (DMP). This <strong>Full</strong> DMP should be mutually agreed between the Data Centre and the Principal Investigator within three months of the start date of the grant.</p>',1,NULL,1024687474,'2013-10-09 15:24:49','2013-10-29 15:41:35','en',0),(206268105,'ESRC Template','ESRC template',1,NULL,850994612,'2013-10-09 15:24:49','2013-10-09 15:24:49','en',NULL),(233283588,'CRUK Template','CRUK template',1,NULL,394923695,'2013-10-09 15:24:49','2013-10-09 15:24:49','en',NULL),(236958085,'MRC Template','MRC template',1,NULL,922528504,'2013-10-09 15:24:49','2013-10-09 15:24:49','en',NULL),(829965731,'AHRC Template','AHRC template',1,NULL,766049908,'2013-10-09 15:24:49','2013-11-13 11:44:38','en',0),(840843529,'STFC Template','STFC template',1,NULL,741010468,'2013-10-09 15:24:49','2013-10-09 15:24:49','en',NULL),(904593081,'Wellcome Trust Template','Wellcome Trust template',1,NULL,1046357252,'2013-10-09 15:24:49','2013-10-09 15:24:49','en',NULL),(1020170274,'DMP Template','The default DCC template',1,NULL,720679528,'2013-10-09 15:24:49','2013-10-09 15:24:49','en',1);
