INSERT INTO `phases` VALUES (163848150,'CRUK Data Management Questions','<p>All applicants seeking funding from Cancer Research UK will be required to submit a data sharing plan as part of their research grant proposal. If data sharing is not appropriate, applicants must include a clear explanation why. The data sharing plan will be reviewed as part of the funding decision.</p>',1,233283588,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,'http://www.cancerresearchuk.org/science/funding/terms-conditions/funding-policies/policy-data-sharing/data-sharing-guidelines/'),(223238897,'ESRC Data Management Questions','<p>The ESRC requires that all applicants seeking ESRC funding include a statement on data sharing in the relevant section of the Je-S application form. If data sharing is not possible, the applicant must present a strong argument to justify their case.</p>',1,206268105,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,'http://www.esrc.ac.uk/_images/Research_Data_Policy_2010_tcm8-4595.pdf'),(231377878,'Outline for application','<p>NERC proposals should normally be accompanied by a Case for Support, and the length of these is specific to each scheme. In all cases this length should be increased by one page to be used for the Outline Data Management Plan.</p>',1,145199482,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,'http://www.nerc.ac.uk/research/sites/data/documents/odmp-guidance.pdf'),(331789757,'BBSRC Data Management Questions','<p>All applications seeking research grant funding from BBSRC must submit a statement on data sharing. This should include concise plans for data management and sharing as part of research grant proposal or provide explicit reasons why data sharing is not possible or appropriate. The “statement on data sharing” will be included as an additional page in the case for support.</p>',1,38016095,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,'http://www.bbsrc.ac.uk/web/FILES/Policies/data-sharing-policy.pdf'),(348379762,'Detail following award','<p>The Case for Support for successful proposals will be made available to the NERC <a href=\'http://www.nerc.ac.uk/research/sites/data/index.asp?cookieConsent=A\'>Environmental Data Centres</a> and, where appropriate, used to draft, in collaboration with the Principal Investigator, a full Data Management Plan (DMP). This full DMP should be mutually agreed between the Data Centre and the Principal Investigator within three months of the start date of the grant.</p>',2,145199482,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,'http://www.nerc.ac.uk/research/sites/data/documents/dmp-template.pdf'),(397849176,'MRC Data Management Questions',NULL,1,236958085,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,NULL),(457039136,'Wellcome Trust Data Management Questions',NULL,1,904593081,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,NULL),(611646838,'DCC Data Management Questions',NULL,1,1020170274,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,NULL),(783824917,'AHRC Data Management Questions','<p>A Technical Plan should be no more than four pages long and provided for all applications where digital outputs or digital technologies are an essential part to the planned research outcomes.</p>',1,829965731,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,'http://www.ahrc.ac.uk/Funding-Opportunities/Research-funding/RFG/Application-guidance/Pages/Technical-Plan.aspx'),(983922625,'STFC Data Management Questions',NULL,1,840843529,'2013-10-09 15:24:49','2013-10-09 15:24:49',NULL,NULL);
